// root
function App(){
    return(
<>

 <div className="card" >
    <img className="card-img-top" src="https://wallpapercave.com/wp/wp4056410.jpg" alt="Card image" />
    <div className="card-body">
      <p className="card-text">A Netflix Orignal Series</p>
      <h4 className="card-title">Dark</h4>
      <a href="#" className="btn btn-primary">See Profile</a>
    </div>
  </div>
</>

    );
}

ReactDOM.render(

<>
<App/>
</>
,document.getElementById('root'));
